import "./App.css";

import Logo from "./componentes/Logo/index";

const textOption = ["Categories", "Library", "Favorites"];
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo></Logo>
        <ul className="options">
          {textOption.map((text) => (
            <li className="option">
              <p>{text}</p>
            </li>
          ))}
        </ul>
      </header>
    </div>
  );
}

export default App;
